import React from 'react'; 
import { Col, Row, Container, Card } from 'react-bootstrap'; 


const Project = () => (

    <div>
        <h1>Projects</h1>
        <Container>
            <Card>
                <Card.Header>BTP.dev</Card.Header>
                    <Card.Body>
                        <Card.Title>Working As A Team</Card.Title>
                        <Card.Img src={require("../assets/images/btpFrontPage.png")} />
                            <Card.Text>

                            </Card.Text>
                    </Card.Body>

            </Card>

        </Container>

    </div>
);

export default Project;
